import React from 'react'
import minus from '../../images/minus.png'
import down from '../../images/down.png'
import up from '../../images/up.png'
import {SentimentData} from './searchcards'

const SentimentCard = ({sentiment,logo_url,price}:SentimentData) =>{
    let icon = <img src={minus} alt="minus" className="h-8"/>
    if(sentiment < 0)
        icon = <img src={down} alt="down" className="h-8"/>
    if(sentiment > 0)
        icon = <img src={up} alt="up" className="h-8"/>
    return(
        <div className="border border-gray-200 flex items-center my-4 rounded-xl p-2 shadow-xl h-16 justify-center">
            <div className="flex">
                {logo_url?<img src={logo_url} alt="" className="w-10 h-10 mr-3"/>:null}
                <h1 className="text-xl">Overall Sentiment:</h1>
                <h1 className="text-xl px-2">{Number((sentiment).toFixed(3))}</h1>
                {icon}
            </div>
        </div>
    )
}
export default SentimentCard
